Here is the Solidity contract code equivalent:

```solidity
pragma solidity ^0.6.0;

contract Contract {

    address private owner;
    mapping(address => uint256) private balances;
    mapping(bytes32 => bytes32) private storageData;

    constructor() public {
        owner = msg.sender;
    }

    function transfer(address _to, uint256 _value) public {
        require(msg.sender == owner, "Only owner can transfer");
        require(balances[msg.sender] >= _value, "Insufficient balance");
        balances[msg.sender] -= _value;
        balances[_to] += _value;
    }

    function deposit() public payable {
        require(msg.sender == owner, "Only owner can deposit");
        balances[msg.sender] += msg.value;
    }

    function withdraw(uint256 _value) public {
        require(msg.sender == owner, "Only owner can withdraw");
        require(balances[msg.sender] >= _value, "Insufficient balance");
        msg.sender.transfer(_value);
        balances[msg.sender] -= _value;
    }

    function setStorage(bytes32 _key, bytes32 _value) public {
        require(msg.sender == owner, "Only owner can set storage");
        storageData[_key] = _value;
    }

    function getStorage(bytes32 _key) public view returns (bytes32) {
        require(msg.sender == owner, "Only owner can get storage");
        return storageData[_key];
    }

    function main() public payable {
        require(msg.sender == owner, "Only owner can call main");
        deposit();
    }

    receive() external payable {
        require(msg.sender == owner, "Only owner can send value");
        deposit();
    }
}
```

